import React, { useState } from 'react';
import { useInView } from 'react-intersection-observer';

const FeatureRow = ({ feature, values }) => {
  const [ref, inView] = useInView({
    triggerOnce: true,
    threshold: 0.1,
  });

  return (
    <div 
      ref={ref}
      className={`grid grid-cols-7 gap-4 py-8 border-b border-gray-200 hover:bg-gray-50 transition-all duration-300 ${
        inView ? 'opacity-100 translate-y-0' : 'opacity-0 translate-y-10'
      }`}
    >
      <div className="font-medium text-gray-900 sticky left-0 bg-white text-xl">{feature}</div>
      {values.map((value, index) => (
        <div key={index} className="text-center text-lg">{value}</div>
      ))}
    </div>
  );
};

const PlanHeader = ({ plan, isAnnual }) => {
  const [ref, inView] = useInView({
    triggerOnce: true,
    threshold: 0.1,
  });

  return (
    <div 
      ref={ref}
      className={`text-center transition-all duration-300 ${
        inView ? 'opacity-100 translate-y-0' : 'opacity-0 translate-y-10'
      }`}
    >
      <h3 className="text-xl font-semibold text-gray-900">{plan.name}</h3>
      <p className="text-4xl font-bold text-indigo-600 mt-4">
        {plan.price === "Custom" ? (
          "Custom"
        ) : (
          <>
            ${isAnnual ? plan.price : Math.round(plan.price * 1.2)}
            <span className="text-base font-normal text-gray-500">/mo</span>
          </>
        )}
      </p>
      {plan.isPopular && (
        <span className="inline-block bg-indigo-100 text-indigo-800 text-sm px-3 py-1 rounded-full uppercase font-semibold tracking-wide mt-4">
          Most Popular
        </span>
      )}
    </div>
  );
};

const Pricing = () => {
  const [isAnnual, setIsAnnual] = useState(false);

  const plans = [
    {
      name: "Starter VPS",
      price: 5,
      cpu: "1 vCPU",
      ram: "1 GB",
      storage: "25 GB SSD",
      transfer: "1 TB",
      backups: "Weekly",
      support: "Email",
    },
    {
      name: "Basic VPS",
      price: 10,
      cpu: "2 vCPU",
      ram: "2 GB",
      storage: "50 GB SSD",
      transfer: "2 TB",
      backups: "Daily",
      support: "Email",
    },
    {
      name: "Pro VPS",
      price: 20,
      cpu: "2 vCPU",
      ram: "4 GB",
      storage: "80 GB SSD",
      transfer: "3 TB",
      backups: "Daily",
      support: "24/7 Chat",
      isPopular: true,
    },
    {
      name: "Business VPS",
      price: 40,
      cpu: "4 vCPU",
      ram: "8 GB",
      storage: "160 GB SSD",
      transfer: "4 TB",
      backups: "Hourly",
      support: "24/7 Phone & Chat",
    },
    {
      name: "Enterprise VPS",
      price: 80,
      cpu: "8 vCPU",
      ram: "16 GB",
      storage: "320 GB SSD",
      transfer: "5 TB",
      backups: "Continuous",
      support: "Dedicated Support Team",
    },
    {
      name: "Custom VPS",
      price: "Custom",
      cpu: "Custom",
      ram: "Custom",
      storage: "Custom",
      transfer: "Custom",
      backups: "Custom",
      support: "Tailored Support",
    },
  ];

  return (
    <div className="bg-gray-50 min-h-screen py-20 px-4 sm:px-6 lg:px-8">
      <div className="max-w-7xl mx-auto">
        <h1 className="text-6xl font-extrabold text-gray-900 text-center mb-16">
          Choose Your VPS Plan
        </h1>
        <div className="flex justify-center items-center gap-4 mb-16">
          <button
            onClick={() => setIsAnnual(false)}
            className={`px-6 py-3 rounded-l-md text-lg font-medium ${
              !isAnnual ? 'bg-indigo-600 text-white' : 'bg-gray-200 text-gray-700'
            } transition-colors duration-150`}
          >
            Monthly
          </button>
          <button
            onClick={() => setIsAnnual(true)}
            className={`px-6 py-3 rounded-r-md text-lg font-medium ${
              isAnnual ? 'bg-indigo-600 text-white' : 'bg-gray-200 text-gray-700'
            } transition-colors duration-150`}
          >
            Annual (Save 20%)
          </button>
        </div>
        <div className="bg-white shadow-2xl rounded-lg overflow-hidden">
          <div className="overflow-x-auto">
            <div className="inline-block min-w-full align-middle">
              <div className="overflow-hidden">
                <div className="grid grid-cols-7 gap-4 p-8 bg-gray-100 sticky top-0 z-10">
                  <div className="font-semibold text-gray-900 text-xl">Features</div>
                  {plans.map((plan, index) => (
                    <PlanHeader key={index} plan={plan} isAnnual={isAnnual} />
                  ))}
                </div>
                <div className="divide-y divide-gray-200">
                  <FeatureRow feature="CPU" values={plans.map(p => p.cpu)} />
                  <FeatureRow feature="RAM" values={plans.map(p => p.ram)} />
                  <FeatureRow feature="Storage" values={plans.map(p => p.storage)} />
                  <FeatureRow feature="Transfer" values={plans.map(p => p.transfer)} />
                  <FeatureRow feature="Backups" values={plans.map(p => p.backups)} />
                  <FeatureRow feature="Support" values={plans.map(p => p.support)} />
                </div>
                <div className="grid grid-cols-7 gap-4 p-8 bg-gray-50">
                  <div></div>
                  {plans.map((plan, index) => (
                    <div key={index} className="text-center">
                      <button className="w-full bg-indigo-600 text-white rounded-md py-3 px-6 text-lg font-medium hover:bg-indigo-700 transition duration-150 ease-in-out transform hover:scale-105 hover:shadow-lg">
                        Select Plan
                      </button>
                    </div>
                  ))}
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Pricing;
